import React, { Component } from "react";
import { Container, Row, Col, Button } from 'react-bootstrap';

import { BsFillPersonPlusFill } from 'react-icons/bs';
import "./tableCardHeader.css"
import VeriEkle from './veriEkle.js';

function TableCardHeader({ callBack }) {
    return (
        <Container fluid className="sec-container">
            <Row>
                <Col className="bold">Öğrenci Listesi</Col>
                <VeriEkle callBack={callBack} child={<BsFillPersonPlusFill />} detail={null} tid={-1} />
            </Row>

        </Container>
    )
}


export default TableCardHeader;
